import "./styles.css";
import React ,{Component} from 'react';
import { BrowserRouter, Routes, Link, Route } from 'react-router-dom';
import Home from './home';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <Routes>
        <Route exact path={"/"} component = {Home}></Route>
      </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
